import React from "react";
import Task from "./Task";
//import "./Box.css";

const Box = ({value, namem, click}) => {
	return (
        <div className="fullBox">
            <h2>{name}:</h2>
            <div className="box box-items">
                <Task value={value}/>
                <button onClick={click}>+</button>
            </div>
        </div>
    )
};

export default Box;
